import React from "react";

import { Route, Routes, Navigate } from "react-router-dom";

import Login from "../pages/Login";

function AuthNavigator() {
  return (
    <Routes>
      <Route path="/login" element={<Login />} />
      <Route path="/*">
        <Navigate
          to={{
            pathname: "/login",
          }}
        />
      </Route>
    </Routes>
  );
}

export default AuthNavigator;
